import styled from "styled-components";

const DisplayCounter = styled.div`
  color: #282c34;
  background: #fff;
  padding: 8px 0;
  text-align: center;
  margin: 0 10px;
  border-radius: 4px;
  width: 105px;
  border: 1px dashed #03a9f3;
  display: inline-block;
`;

export default DisplayCounter;
